import styled from "@emotion/styled";

export const HeaderWrapper = styled.div`
  display: flex;
  justify-content: flex-end;
  align-items: center;
  margin-bottom: 80px;
`;

export const StyledSvg = styled.svg`
  width: 12px;
  height: 12px;
  fill: #afafaf;
`;
